    48 states, served by USDA-FSA Aerial Photography Field Office. It also provides
    the URL for the seamline services, which provides the image dates and other pertinent
    information about the NAIP acquisition. In addition, there are reference points
    to how to download NAIP CCMs and how to order uncompressed NAIP digital ortho quarter
    quad tiles (DOQQs), historical NAIP, and other historical imagery dating back to
